import axios from 'axios'
const Banner = require('./banner')


const App = () => {
  const banner = new Banner('utb')
  const [sections, setSections] = useState([])
  useEffect(() => {
    setSections(banner.getCampuses())
  }, [])

  return(
    <div>
    <ul>
      {sections.map( section => <li>section</li>)}
    </ul>
    </div>)
}

export default App;
